/** @format */

import logo from "./logo.svg";
import "./App.css";
import { useEffect, useState } from "react";
import ItemsList from "./components/ItemsList";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div className="App-intro">
          <h2>Clients</h2>
          <ItemsList />
        </div>
      </header>
    </div>
  );
}

export default App;
